import React from 'react';
import '../App.css';
const Firstsec = ()=>{
    return(
        <div class="images">
        <div class="photo">
            <img src="" alt="photo" />
        </div>
  
        <div class="photo">
            <img src="tom2.jpg" alt="photo" />
        </div>
          
        <div class="photo">
            <img src="tom3.jpg" alt="photo" />
        </div>
    </div>
    );
}

export default Firstsec;
